import React from 'react';

const Footer = () => {
  return (
    <footer id="contact" className="relative overflow-hidden flex justify-between items-center py-6 px-5 text-white bg-gradient-to-t from-orange-600 to-black">
      {/* Overlay */}
      <div className="absolute inset-0 bg-gradient-to-t from-[rgba(255,82,14,0.9)] to-black backdrop-blur-md z-[-1]"></div>

      <div className="container mx-auto flex flex-wrap justify-between items-start">
        {/* Logo and Call-to-Action */}
        <div className="flex flex-col items-start">
          <h2 className="text-xl font-bold mb-2">LogoFolio.</h2>
          <a
            href="images/My Resume.pdf"
            download
            className="bg-orange-600 text-white py-2 px-4 rounded-md mt-5 transition-all hover:bg-white hover:text-orange-600 font-bold"
          >
            Download CV
          </a>
        </div>

        {/* Navigation Links */}
        <div className="flex flex-col items-start mt-5 md:mt-0">
          <ul className="space-y-2">
            {['Home', 'About', 'Services', 'Skills', 'Portfolio'].map((item) => (
              <li key={item}>
                <a
                  href={`#${item.toLowerCase()}`}
                  className="relative inline-block text-center w-24 h-8 overflow-hidden"
                >
                  <span className="absolute w-full h-full top-0 left-0 transition-transform transform translate-y-0 hover:-translate-y-full">
                    {item}
                  </span>
                  <span className="absolute w-full h-full top-full left-0 transition-transform transform translate-y-0 hover:-translate-y-full">
                    {item}
                  </span>
                </a>
              </li>
            ))}
          </ul>
        </div>

        {/* Additional Links */}
        <div className="flex flex-col items-start mt-5 md:mt-0">
          <ul className="space-y-3">
            {[
              {
                text: 'raohamza1608@gmail.com',
                icon: 'fa-envelope',
                link: 'https://mail.google.com/',
              },
              {
                text: 'mhamzarao@outlook.com',
                icon: 'fa-envelope',
                link: 'https://outlook.live.com/',
              },
              {
                text: '0315-8168145',
                icon: 'fas fa-phone',
                link: 'tel:03158168145',
              },
            ].map(({ text, icon, link }) => (
              <li key={text} className="relative">
                <a
                  href={link}
                  className="flex items-center gap-2 w-64 h-8 relative overflow-hidden group"
                >
                  <span className="absolute inset-0 bg-transparent group-hover:bg-orange-600 transition-all" />
                  <span className="z-10 flex items-center gap-2">
                    {text}
                    <i className={`fa ${icon}`}></i>
                  </span>
                </a>
              </li>
            ))}

            <li>
              <a
                href=" "
                className="flex items-center gap-2 w-64 h-8 relative overflow-hidden group"
              >
                <img
                  src="images/unnamed.jpg"
                  alt="Creator Profile"
                  className="w-8 h-8 rounded-full"
                />
                <span className="z-10">Created by Hamza Rao</span>
              </a>
            </li>
          </ul>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
